import fetch from 'isomorphic-unfetch'
export default Test = (page) => {
    console.log("dsdsds")
    var url = 'https://newsapi.org/v2/everything?' +
        'q=tech&' +
        'sortBy=popularity&' +
        'page=' + page + '&' +
        'pageSize=1&' +
        'apiKey=3b214239993247f18926b8fab6ee014f';
    fetch(url).then(response => response.json())
        .then(json => {
            return json
        })
}
